import React, { useState } from 'react';
import { Layout as AntLayout, Menu } from 'antd';
import { MenuOutlined } from '@ant-design/icons';

const { Header, Content, Footer } = AntLayout;

const MyLayout = () => {
    const [submenuVisible, setSubmenuVisible] = useState(false);

    const toggleSubmenu = () => {
        setSubmenuVisible(!submenuVisible);
    };

    return (
        <AntLayout style={{ minHeight: '100vh' }}>
            <Header>
                <Menu.SubMenu
                    key="sub1"
                    title={<span onClick={toggleSubmenu}>Articles on HTML5 & CSS3</span>}
                    popupClassName={submenuVisible ? "submenu-open" : ""}
                >
                    <Menu theme="dark" mode="horizontal" defaultSelectedKeys={['0']} style={{ width: 'fit-content' }}>
                        <MenuOutlined onClick={toggleSubmenu} style={{ marginLeft: 'auto', fontSize: '20px', cursor: 'pointer' }} />
                        <Menu.Item key="1"><a href="http://www.jochaho.com/wordpress/">Home</a></Menu.Item>
                        <Menu.Item key="2"><a href="http://www.jochaho.com/wordpress/about-pritesh-badge/">About Me</a></Menu.Item>
                        <Menu.Item key="6"><a href="http://www.jochaho.com/wordpress/category/news/">News</a></Menu.Item>
                        <Menu.Item key="7"><a href="http://www.jochaho.com/wordpress/about-pritesh-badge/">Contact Us</a></Menu.Item>
                    </Menu>
                </Menu.SubMenu>
            </Header>
            <Content style={{ padding: '0 50px' }}>
                <div className="site-layout-content">
                    {/* Restul con»õinutului */}
                </div>
            </Content>
            <Footer style={{ textAlign: 'center' }}>
                Contact: contact@exemplu.com | Telefon: +1234567890
            </Footer>
        </AntLayout>
    );
};

export default MyLayout;
